import Comp from "./Comp"
import propTypes from 'prop-types'

const Stundent = ({name, age}) => {
  return (
   <>
    <Comp 
        name={name}
    />
    <div>Stundents {name}</div>
    <h1>{age}</h1>
   </>
  )
}

Stundent.propTypes = {
    name: propTypes.number,
    age: propTypes.number,
}
export default Stundent
